import React from 'react'
import ProjectSummary from './ProjectSummary';


const PorjectList =()=> {
    return (
        <div className="project-list section"> 
           <ProjectSummary yazaradi="Muhammet METİN"></ProjectSummary>
           <ProjectSummary yazaradi="Ophan PAMUK"></ProjectSummary>
           <ProjectSummary yazaradi="Mustafa ATAŞ"></ProjectSummary>
           <ProjectSummary yazaradi="Mustafa ÖZKAN"></ProjectSummary>
           <ProjectSummary yazaradi="Ahmet TERKİN"></ProjectSummary>
        </div>
    )
}

export default PorjectList;
